import React from 'react';
import './NewRestTimer.scss';
import { prettyDisplayTime } from '../utils/displayHelpers';

const newRestTimer = props => {
  let totalSeconds = 179;
  function startTimer() {
    props.startTimer('rest', totalSeconds);
    props.toggleModal();
  }

  return (
    <div id="new-rest-timer">
      <div id="timer">
        <div className="timer-display">
          <b>{prettyDisplayTime(totalSeconds)}</b>
        </div>
        <button
          type="button"
          className="button-one time-change-button"
          id="minus-30"
          onClick={() => {
            totalSeconds = totalSeconds + 30
            console.log("plus-30 clicked!")
          }
          }
        >
          - 30 Sec
        </button>
        <button
          type="button"
          className="button-one time-change-button"
          id="plus-30"
        >
          + 30 Sec
        </button>
      </div>
      <button
        type="button"
        onClick={props.toggleModal}
        className="button-one action-button"
      >
        SKIP
      </button>
      <button
        type="button"
        onClick={startTimer}
        className="button-one action-button"
      >
        START
      </button>
    </div>
  );
};

export default newRestTimer;
